      const vectorType = this.getVectorFromMatrix(fromType);
      return this.format(`( ${snippet} * ${this.getType(vectorType)}( 1.0 ) )`, vectorType, toType);
    }

    if (toTypeLength === 0) {
      // toType is matrix-like
      // ignore for now
      //return `${ this.getType( toType ) }( ${ snippet } )`;
      return snippet;
    }

